import NoteContext from './nodeContext';
import { useState } from 'react';

const NoteStatus = (props) => {
    const s1 = {
        name : "Harry",
        class : "5b"
    }

const [state, setState]= useState(s1);
 const update = ()=> {
        setTimeout(() => {
            setState({
                name : "Larry",
                class : "10b"
            })
        }, 30);
 }
    
        return(
            <NoteContext.Provider value={state}>
                    {props.children}
            </NoteContext.Provider>
        )
}

export default NoteStatus;
